import React from 'react';
import { SafeAreaView, ScrollView } from 'react-native';
import { Appbar, TextInput } from 'react-native-paper';

export const RegisterScreen = () => {
    return (
        <SafeAreaView>
            <ScrollView>
                <Appbar>
                    <Appbar.BackAction/>
                    <Appbar.Content title="Регистрация"/>
                </Appbar>
                <TextInput label="Имя"/>
                <TextInput label="Фамилия"/>
                <TextInput label="Отчество"/>
                <TextInput label="Телефон" keyboardType='phone-pad'/>
                <TextInput label="Email" keyboardType='email-address'/>
                <TextInput label="Пароль" secureTextEntry={true} right={<TextInput.Icon icon="eye-off-outline"/>}/>
                <TextInput label="Подтверждение пароля" secureTextEntry={true} right={<TextInput.Icon icon="eye-off-outline"/>}/>
            </ScrollView>
        </SafeAreaView>
    );
}
